Located near Tonbridge in Kent, Penshurst Place was once a hunting lodge used by Henry VIII before ownership passed to the Sidney family in 1552. It's home to eleven acres of walled gardens which are a real highlight of Elizabethan design with their water features, colours and ample amounts of plantlife 🌹. It's also accredited by our 'We're Good To Go' scheme. For information on that and more, go to the Know Before You Go link in our bio above ☝️.
